function dropdown2(props) {
  const position = {
    container: "relative",
    wrapper: "absolute right-full w-max *:py-2 *:px-4",
  };
  const design = {
    wrapper: "bg-white rounded-lg *:cursor-pointer",
  };
  return (
    <details className={position.container}>
      <summary>
        <p>{props.heading}</p>
      </summary>
      <div className={`${position.wrapper} ${design.wrapper}`}>
        {props.text.map((item, index) => (
          <p className={`${position.item} ${design.item}`} key={index}>
            {item}
          </p>
        ))}
      </div>
    </details>
  );
}

export default dropdown2;
